import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Fab from '@material-ui/core/Fab';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import NavigationIcon from '@material-ui/icons/Navigation';

const styles = theme => ({
  root: {
    ...theme.mixins.gutters(),
    paddingTop: theme.spacing.unit * 2,
    paddingBottom: theme.spacing.unit * 2,
    height: "15rem",
    flexGrow: 1,
},
paper: {
  padding: theme.spacing.unit * 2,
  justifyContent: 'center',
  color: 'white',
},
});

function PaperSheet(props) {
  const { classes } = props;

  return (
    <div>
      <Paper className={classes.root} elevation={1}>
        <Grid container className={classes.paper}>
        <Grid item xs={4}>
        <Typography variant="h5" component="h3">
        <Fab color="primary" aria-label="Add" className={classes.margin}>
          <NavigationIcon className={classes.extendedIcon} />
          Extended
        </Fab>
          Poet
        </Typography>
        <Typography component="p">
          Bio: Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas ultricies id massa vitae volutpat. Praesent tempus lorem purus, at iaculis nunc sollicitudin ac. Donec finibus sed urna a malesuada.
        </Typography>
        </Grid>
        </Grid>
      </Paper>
    </div>
  );
}

PaperSheet.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(PaperSheet);
